                pagina: Tela_Dados_Entrada
            },
            {
                idMenu: 2,
                largura: 150,
                nome: "Identificação",
                descricao: "",
                pagina: Tela_Socio_Identificacao
            },
            {
                idMenu: 3,
                largura: 200,
                nome: "Situação Jurídica",
                descricao: "",
                pagina: Tela_SitJuridica
            },
            {
                idMenu: 4,
                largura: 180,
                nome: "Proteção-segurança",
                descricao: "",
                pagina: Tela_Protecao_Seguranca
            },
            {
                idMenu: 5,
                largura: 240,
                nome: "Vitimização secundária e terciária",
                descricao: "",
                pagina: Tela_Vitimizacao
            }
        ]
        )
    },
    With(
        {
            // Acrescenta a coluna "larguraCalc" conforme regra:
            // Se o item for o selecionado (_passoAtual.idMenu), usa a largura definida;
// Senão, divide o espaço restante igualmente entre os demais itens.
menuCalc: AddColumns(
                menu,
                larguraCalc,
                If(
                    pagina = MenuPassos.TelaAtual,
                    largura,
                    If(pagina = Tela_Vitimizacao, largura,
                    ((Self.Width - 100) - LookUp(
                        menu,
                        pagina = MenuPassos.TelaAtual,
                        largura
                    )) / (CountRows(menu) - 1))
                )
            )
        },
        // Ordena os itens pelo idMenu e calcula a posição "distancia" de cada item
// somando as larguras calculadas dos itens anteriores.
        AddColumns(
            SortByColumns(
                menuCalc,
                "idMenu",
                SortOrder.Ascending
            ) As m1,
            distancia,
            Sum(
                Filter(
                    menuCalc,
                    idMenu < m1.idMenu
                ),
                larguraCalc
            )
        )
    )
)

